import { TabMenu } from 'primereact/tabmenu';

const Navbar = () => {
    const items: object[] = [
        {label: "Home", icon: 'pi pi-fw pi-home'}
    ]

    return ( 
    <>
        <TabMenu model={items}/>
    </>
        );
}

export default Navbar;
